import { Link } from "react-router-dom";

function Navigation(){
    return(
        <>
            <nav className="menu">
                <ul>
                    <li>
                        <Link to ="/">Home</Link>
                    </li>
                    <li>
                        <Link to ="/world-news">World</Link>
                    </li>
                </ul>
            </nav>
        </>
    )
}

export default Navigation;
